import React from 'react';
import { Parallax  } from '@react-spring/parallax';
import Nbar from '../NavxFooter/NavBar';
import PresentationWeb from './Pres';
import SecSectionP from './SecSectionP';
import Foo from '../NavxFooter/Footer';
import TsectionP from './TsectionP';

const PageF1 = () => {
  return (
    <Parallax bgImage="castle.jpg" strength={500}>
      <div className="bg-white dark:bg-black">
        <Nbar />

        <Parallax.Layer offset={0} speed={0.1}>
          <PresentationWeb />
        </Parallax.Layer>

        <Parallax.Layer offset={1} speed={0.2}>
          <SecSectionP />
        </Parallax.Layer>

        <Parallax.Layer offset={2} speed={0.3}>
          <TsectionP />
        </Parallax.Layer>

        <Parallax.Layer offset={3} speed={0.4}>
          <Foo />
        </Parallax.Layer>
      </div>
    </Parallax>
  );
};

export default PageF1;
